import React, { Component } from "react";

export default class PresentesAdmin extends Component {

  render() {
    return (
      <div className="wrap-content">

        <div className="content-title">
            <div className="flex flex-baseline flex-space">
                <div>
                    <h1>Dashboard</h1>
                    <h2>Você está no painel principal</h2>
                </div>
                <div className="filter-admin">
                    <select name="filter_date" id="" className="select-filter-admin select-filter-date">
                        <option value="day">Diário</option>
                        <option value="week" selected>Semanal</option>
                        <option value="month">Mensal</option>
                    </select>
                </div>
            </div>
        </div>

      </div>
    );
  }
}
